import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import '../Login/Login.css';


function Login() {
  return (
    <div className="lognbg">

      <div className="logbg ">

        <div className='login mt-5'>
          <span className='title text-warning'>Login</span>

          <form action="" className='formdata mt-5'>

            <input type="text"
              placeholder='Username'
              name='username'
              className='user' />
            <br />

            <input type="password"
              placeholder='Password'
              className='pass m-3' />
            <br />

            <a href='' className='forge'>forget password?</a>
            <br />
            <span><input type="checkbox" /> Remember me</span><br />

            <button>Login</button><br />
            <span>have no account?<a href="">signup</a></span>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Login;
